pragma solidity ^0.4.24;

import "./SafeMath.sol";

contract BinaryBetting {
    using SafeMath for uint256;
    
    uint256 public constant DICE_DURATION= 20;
    uint256 public constant REFUND_PERCENT= 98;
    uint256 public constant REWARD_PERCENT= 98;
    uint256 public constant INACTIVE_DURATION= 60*60*24; //24 hours inactive room, locked but nobody calls getWinner() 

    uint256 public pendingAmount;
    uint256 public totalIncome; //since contract deployed

    address public bank;

    enum PlayerState {
        Free,
        Joined,
        HashSent,
        RandomSent,
        Failed
    }
    
    enum RoomState {
        NotCreated,
        WaitingPlayer,
        WaitingHash,
        WaitingRandom
    }

    struct RoomAtribute {
        address[] playerAddress;
        uint256 endTime;
        uint256 count;
        RoomState state;
    }

    struct RoomId{
        uint256 factor;
        uint256 amount;
        uint256 id;
    }

    struct Player {
        RoomId roomId;
        PlayerState state;
        bytes32 hstring;
        uint256 random;
        uint256 pos;
    }

    address public owner;

    uint256 public ownerPercent;
    uint256 public verifyDuration;

    uint256[] public amounts;
    uint256[] public factors;
    
    mapping(uint256 => bool) public amountExist;
    mapping(uint256 => bool) public factorExist;
    
    mapping(uint256 => mapping(uint256 => uint256)) public roomNumber;
    mapping(uint256 => mapping(uint256 => mapping(uint256 => RoomAtribute))) public room;

    mapping(address => Player) public player;

//Modifiers

    modifier onlyOwner() {
        require(msg.sender == owner, "Onwer Only");
        _;
    }
    
//Events
    event RoomLocked(uint256 _amount, uint256 _factor, uint256 _id);
    event RoomCleaned(uint256 _amount, uint256 _factor, uint256 _id);
    
    event JoinSuccess(address _address, uint256 _id, uint256 _pos);
    event RefundSuccess(address _address,uint256 _amount);
    event LeaveSuccess(address _address);
    
    event BadNews(address _address);
    event GoodNews(address _address, uint256 _amount);
    
    event HashRequest(uint256 _amount, uint256 _factor, uint256 _id);
    event HashSent(address _address);
    
    event RandomRequest(uint256 _amount, uint256 _factor, uint256 _id);
    event RandomSent(address _address);
    
//////////////Functions
    
//////////////////////////////////////Owner's Functions

    constructor (address _bank) public{
    //constructor () public{
        owner = msg.sender;
        bank = _bank;
        _initForAdmin();
        pendingAmount = 0;
        totalIncome = 0;
    }

//add new amount for betting
    function addAmount(uint256 _amount) public onlyOwner {
        require(!amountExist[_amount], "Amount already exist");
        amounts.push(_amount);
        amountExist[_amount] = true;
    }

//add new factor for betting
    function addFactor(uint256 _factor) public onlyOwner {
        require(!factorExist[2 ** _factor], "Factor already exist");
        factors.push(2 ** _factor);
        factorExist[2 ** _factor] = true;
    }

    function pushToBank() public  {
        bank.transfer(address(this).balance.sub(pendingAmount));
    }
   
    //clean all inactive rooms
    function cleanInactiveRooms() onlyOwner  public {
        RoomId memory roomId;
        for (uint256 i = 0; i < amounts.length; i++)
        for (uint256 j = 0; j < factors.length; j++) {
            uint256 _amount = amounts[i];
            uint256 _factor = factors[j];        
            for (uint256 _id = 0; _id < roomNumber[_amount][_factor]; _id ++){
                uint256 endTime = room[_amount][_factor][_id].endTime;
                bool isLocked = room[_amount][_factor][_id].state != RoomState.WaitingPlayer;
                if ((isLocked) && (now.sub(endTime) > INACTIVE_DURATION)) {
                    roomId.amount = _amount;
                    roomId.factor = _factor;
                    roomId.id = _id;
                    cleanRoom(roomId);
                }
            }
        }
    }

    function getBalance() public view returns(uint256) {
        return address(this).balance;
    }

//////////////////////////////////////Players's Functions
    
    function roomAsleep() public view returns (bool) {
        return (player[msg.sender].state != PlayerState.Free) && 
            (getRoomState() != RoomState.WaitingPlayer) && 
            (roomStateExpired(player[msg.sender].roomId));
    }

    function roomWakeUp() public {
        require(roomAsleep(),"Room state must be expired");
        if (getRoomState() == RoomState.WaitingHash) {
            toWaitingRandom(player[msg.sender].roomId);
        } else {
            activeRoundFighting();
        }
    }

    function activeRoundFighting() public{
        require(player[msg.sender].state != PlayerState.Free, "Player not joined any room");
        address _address = msg.sender;
        RoomId storage roomId = player[_address].roomId;
        require(room[roomId.amount][roomId.factor][roomId.id].state == RoomState.WaitingRandom, "still waiting for more players");
        //only if all verified or timeout
        require(roomReady(roomId) || roomStateExpired(roomId), "room not ready to change state");
        //if not enough verify for this round and time for verify passt
        fighting(roomId);
    }
    
    function sendHash(bytes32 _hstring) public {
        address _address = msg.sender;
        require(getRoomState() == RoomState.WaitingHash, "current room state  isnt waiting for hash");
        require(player[_address].state != PlayerState.HashSent, "player sent hash already"); 
        require(player[_address].state != PlayerState.Failed, "player failed last round"); 
        require(player[_address].state != PlayerState.Free, "player not joined any room"); 
        
        RoomId storage roomId = player[_address].roomId;
        if (roomStateExpired(roomId)) {
            toWaitingRandom(roomId);
        } else {
            player[_address].hstring = _hstring;
            player[_address].state = PlayerState.HashSent;
            room[roomId.amount][roomId.factor][roomId.id].count++;
            emit HashSent(_address);
            if (roomReady(roomId)) toWaitingRandom(roomId);
        }
    }
    
    function sendRandom(uint256 _random) public {
        address _address = msg.sender;
        RoomId memory roomId = player[_address].roomId;
        require(getRoomState() == RoomState.WaitingRandom, "current room state isnt waiting for random");
        require(player[_address].state == PlayerState.HashSent, "player didnt send hash before or failed on last round"); 
        
        if (roomStateExpired(roomId)) {
            //timeout for verify
            player[_address].state = PlayerState.Failed;
            activeRoundFighting();
        } else {
            //check random with the last sent hash (hstring)
            if (!hashVerify(_random.toBytes(), player[_address].hstring)) {
                player[_address].state = PlayerState.Failed;
            } else player[_address].state = PlayerState.RandomSent;

            room[roomId.amount][roomId.factor][roomId.id].count++;
            player[_address].random = _random;
            emit RandomSent(_address);
            //if all verified or failed, then get round result
            if (roomReady(roomId)) activeRoundFighting();
        }
    }
    
    function joinRoom(uint256 _amount, uint256 _factor, uint256 _id) public payable {
        //can join direct without join joinQueue, check locked room
        address _address = msg.sender;
        require(msg.value >= _amount.etherToWei(), "sent amount not enough to join");
        require(player[msg.sender].state == PlayerState.Free, "player already joined a room");
        require(room[_amount][_factor][_id].state == RoomState.WaitingPlayer, "current room state isnt waiting for players");
        player[_address].state = PlayerState.Joined;
        RoomId memory roomId = RoomId({amount : _amount, factor : _factor , id : _id});
        player[_address].roomId = roomId;
        uint256 _pos = room[_amount][_factor][_id].playerAddress.length;
        player[_address].pos = _pos;
        room[_amount][_factor][_id].playerAddress.push(_address);
        emit JoinSuccess(_address, _id, _pos);
        pendingAmount = pendingAmount.add(_amount.etherToWei());
        totalIncome = totalIncome.add(_amount.etherToWei());
        //if room full, lock room then
        if (room[_amount][_factor][_id].playerAddress.length == _factor) {
            toWaitingHash(roomId);
        }
    }
    
    function joinQueue(uint256 _amount, uint256 _factor) public payable{
        require(amountExist[_amount], "this amount is unavaiable");
        require(factorExist[_factor], "this factor is unavaiable");
        require(msg.value >= _amount.etherToWei(), "sent amount not enough to join");
        uint256 _id = getFirstFreeRoom(_amount, _factor);
        joinRoom(_amount, _factor, _id);
        //if room ready to Dice, lock room and emit
    }
    
    function leaveQueue() public {
        //require(player[msg.sender].exist);
        require(player[msg.sender].state != PlayerState.Free, "player not joined any room to leave");
        RoomId storage _roomId = player[msg.sender].roomId;
        require(getRoomState() == RoomState.WaitingPlayer, "current room state isnt waiting for players"); // Room locked, nobody can run
        uint256 refundAmount = _roomId.amount.etherToWei().div(100).mul(REFUND_PERCENT);
        require(refundAmount <= address(this).balance, "contract wallet doesnt have enough to refund");
        leaveRoom(_roomId);
        totalIncome = totalIncome.sub(refundAmount);
        msg.sender.transfer(refundAmount);
        emit RefundSuccess(msg.sender, refundAmount);
    }
    
//////////////////////////////////////Dapps Functions to read data

//get avaiable amounts
    function getAmounts() public view returns(uint256[]){
        return amounts;
    }

//get avaiable factors = number of players in room
    function getFactors() public view returns(uint256[]){
        return factors;
    }

//get number of rooms with a selected pair amount and factor
    function getRoomNumber(uint256 _amount, uint256 _factor) public view returns(uint256){
        return roomNumber[_amount][_factor];
    }
 
//get current room state : Not Created, Waiting -Player, -Hash, -Random
    function getRoomState() public view returns(RoomState) {
        require(player[msg.sender].state != PlayerState.Free, "player not joined any room");
        uint256 _amount = player[msg.sender].roomId.amount;
        uint256 _factor = player[msg.sender].roomId.factor;
        uint256 _id = player[msg.sender].roomId.id;
        return room[_amount][_factor][_id].state;
    }

//get current number of players in room, reduce a halb after every round
    function getRoomRestPlayers() public view returns(uint256) {
        require(player[msg.sender].state != PlayerState.Free, "player not joined any room");
        uint256 _amount = player[msg.sender].roomId.amount;
        uint256 _factor = player[msg.sender].roomId.factor;
        uint256 _id = player[msg.sender].roomId.id;
        return room[_amount][_factor][_id].playerAddress.length;
    }

//get current players in room
    function getRoomPlayerList(uint256 _amount, uint256 _factor, uint256 _id) public view returns(address[]) {
        return room[_amount][_factor][_id].playerAddress;
    }

//get player state : Free, Joined, HashSent, RandomSent, Failed
    function getPlayerState() public view returns(PlayerState) {
        return player[msg.sender].state;
    }

//get joined room amount
    function getRoomAmount() public view returns (uint256) {
        require(player[msg.sender].state != PlayerState.Free, "player not joined any room");
        return player[msg.sender].roomId.amount;
    }

// get joined room factor
    function getRoomFactor() public view returns (uint256) {
        require(player[msg.sender].state != PlayerState.Free, "player not joined any room");
        return player[msg.sender].roomId.factor;
    }

//get joined room id
    function getRoomId() public view returns (uint256) {
        require(player[msg.sender].state != PlayerState.Free, "player not joined any room");
        return player[msg.sender].roomId.id;
    }
    
//////////////////////////////////////Contracts Functions, private

//check hash of sent randomNumber with the hash sent before
    function hashVerify(bytes _randomNumber, bytes32 _hashString) private pure returns(bool){
        //return true;
        return (keccak256(_randomNumber) == _hashString);
    }
    
//1 vs 1 fight, player i vs i+1 in a room, result base on state and sent random number
    function solo1vs1(RoomId roomId, uint256 i) private returns (address) {
        address a1 = room[roomId.amount][roomId.factor][roomId.id].playerAddress[i];
        address a2 = room[roomId.amount][roomId.factor][roomId.id].playerAddress[i+1];
        require(a1 != a2, "two compared address must be different");
        address winnerAddress = 0x0;
        if (player[a1].state != PlayerState.RandomSent) winnerAddress = a2;
        if (player[a2].state != PlayerState.RandomSent) winnerAddress = a1;
        //both Verified
        if (winnerAddress == 0x0) {
            winnerAddress = a2;
            // random winner of 2 Players
            if ((player[a1].random + player[a2].random) % 2 == 0) 
            winnerAddress = a1;
        }
        address loserAddress = a1;
        if (winnerAddress == a1) 
            loserAddress = a2;
        freePlayer(loserAddress, true); 

        if (player[winnerAddress].state != PlayerState.RandomSent)
            player[winnerAddress].state = PlayerState.Failed;

        return winnerAddress;
    }
    
    //free player from joined room, 2 case lost or refund
    function freePlayer(address playerAddress, bool lost) private { 
        player[playerAddress].state = PlayerState.Free;
        pendingAmount = pendingAmount.sub(player[playerAddress].roomId.amount.etherToWei());
        if (lost)
            emit BadNews(playerAddress);
    }
    
    //set room state to WaitingPlayer and free all players
    function cleanRoom(RoomId roomId) private {
        uint256 restPlayers = room[roomId.amount][roomId.factor][roomId.id].playerAddress.length;
        for (uint256 i = restPlayers - 1; i >= 0 ; i--) {
            freePlayer(room[roomId.amount][roomId.factor][roomId.id].playerAddress[i], false);
        }
        room[roomId.amount][roomId.factor][roomId.id].playerAddress.length = 0;
        toWaitingPlayer(roomId);
    }

    //check the winner of last round, if verified get reward, else contract is the winner
    //this case happens only if nobody use dapp
    function checkWinner(RoomId roomId) private {
        address winner = room[roomId.amount][roomId.factor][roomId.id].playerAddress[0];
        if (player[winner].state != PlayerState.RandomSent) {
            freePlayer(winner, true);
        }
        else {
            uint256 reward = roomId.amount.mul(roomId.factor).etherToWei().div(100).mul(REWARD_PERCENT);
            totalIncome = totalIncome.sub(reward);
            freePlayer(winner, false);
            winner.transfer(reward);
            emit GoodNews(winner, reward);
        }
        //clean room
        room[roomId.amount][roomId.factor][roomId.id].playerAddress.length = 0;
        toWaitingPlayer(roomId);
    }
    
    //get result of a round, 50% players lose 
    function fighting(RoomId roomId) private {
        uint256 restPlayers = room[roomId.amount][roomId.factor][roomId.id].playerAddress.length;
        // pairs : 0 vs 1, 2 vs 3, 4 vs 5, 6 vs 7 ...
        uint256 i = 0;
        while (i < restPlayers) {
            // i th vs i+1 th player in restPlayers
            address winnerAddress = solo1vs1(roomId, i);
            room[roomId.amount][roomId.factor][roomId.id].playerAddress[i / 2] = winnerAddress;
            player[winnerAddress].pos = i/2;
            i += 2;
        }
        
        room[roomId.amount][roomId.factor][roomId.id].playerAddress.length /= 2;
        
        if (restPlayers == 2) checkWinner(roomId); 
        else toWaitingHash(roomId);
    }
    
    //change room state functions
    function toWaitingPlayer(RoomId roomId) private {
        room[roomId.amount][roomId.factor][roomId.id].count = 0;
        room[roomId.amount][roomId.factor][roomId.id].endTime = now;
        room[roomId.amount][roomId.factor][roomId.id].state = RoomState.WaitingPlayer;
    }
        
    function toWaitingRandom(RoomId roomId) private {
        room[roomId.amount][roomId.factor][roomId.id].count = 0;
        room[roomId.amount][roomId.factor][roomId.id].endTime = now;
        room[roomId.amount][roomId.factor][roomId.id].state = RoomState.WaitingRandom;
        emit RandomRequest(roomId.amount, roomId.factor, roomId.id);
    }
    
    function toWaitingHash(RoomId roomId) private {
        room[roomId.amount][roomId.factor][roomId.id].count = 0;
        room[roomId.amount][roomId.factor][roomId.id].endTime = now;
        room[roomId.amount][roomId.factor][roomId.id].state = RoomState.WaitingHash;
        emit HashRequest(roomId.amount, roomId.factor, roomId.id);
    }
    
    //if all rest players sent hash or verified
    function roomReady(RoomId roomId) private view returns(bool) {
        return (room[roomId.amount][roomId.factor][roomId.id].count ==
            room[roomId.amount][roomId.factor][roomId.id].playerAddress.length);
    }
    
    //time expired for hash or random sending
    function roomStateExpired(RoomId roomId) private view returns(bool) {
        return
        (now.sub(room[roomId.amount][roomId.factor][roomId.id].endTime) > DICE_DURATION);
    }
    
    //get first room with status WaitingPlayer, in case join any room
    function getFirstFreeRoom(uint256 _amount, uint256 _factor) private returns(uint256) {
        for (uint256 _id = 0; _id < roomNumber[_amount][_factor]; _id ++){
            if (room[_amount][_factor][_id].state == RoomState.WaitingPlayer) return _id;
        }
        //all rooms full, create new room with id = _id after the above loop
        RoomAtribute memory roomAtribute = RoomAtribute(new address[](0), 0, 0, RoomState.WaitingPlayer);
        room[_amount][_factor][_id] = roomAtribute;
        roomNumber[_amount][_factor]++; //increase number of rooms for this amount, factor
        return _id; // create new room if all rooms full
    }

    //leave room, only if room state still = WaitingPlayer
    function leaveRoom(RoomId roomId) private {
        //move last Player to pos of msg.sender and delete last ele
        uint256 pos = player[msg.sender].pos;
        uint256 l = room[roomId.amount][roomId.factor][roomId.id].playerAddress.length;
        address lastPlayer = room[roomId.amount][roomId.factor][roomId.id].playerAddress[l-1];
        room[roomId.amount][roomId.factor][roomId.id].playerAddress[pos] = lastPlayer;
        player[lastPlayer].pos = pos;
        //delete last element
        room[roomId.amount][roomId.factor][roomId.id].playerAddress.length--;
        freePlayer(msg.sender, false);
    }
    
    //////////////////////////////////////testing Functions
    
    function _initForAdmin() public onlyOwner { //tested
        addAmount(1);
        addAmount(2);
        addAmount(5);
        
        addFactor(1);
        addFactor(2);
        addFactor(3);
        
    }

//return total profit of this contract since it deployed
    function getProfit() public view returns(uint256) {
        return totalIncome.sub(pendingAmount);
    }

}
